import data from "../data/data"
import Project from "../components/Project"


const App = () =>{
    // <p>Components go here</p>
    return (
        <div> {
            data.map ((project, notes) =>
                <Project key={project} notes={notes}/>
            ) 
        }
        </div>
    )
}


export default App;
